  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the Benson
  Wetland Management District outlines District accomplishments during the 1979 calendar
  year. The report begins by describing the climate and habitat conditions in the
  District, as well as the land acquisition program and funding. The collections and
  maintenance section describes physical developments, maintenance, and wildfires.
  The habitat management section discusses grasslands, croplands, vegetation control,
  haying, grazing, wetlands, forest lands, and easements for waterfowl management.
  Wildlife- including migratory birds, big game animals, and raptors- are discussed.
  The public relations sections describes recreational uses, enforcement, and safety.
  Items of interest and photographs are attached.\",\n\t\"license_title\": \"License
